import React, { useEffect, useState, useRef } from "react";
import axios from "axios";
import img1 from "../../assets/images/products/wade-10-lavender-main.jpg";
const KidsProductList = () => {
  const [kidsproductData, setData] = useState([]);
  useEffect(() => {
    axios
      .get(`https://admin.lining.com.np/api/Kids/${kidsproductData}`)
      .then((response) => {
        console.log("kids", response);
        setData(response.data.items);
      })
      .catch((e) => {
        console.log("e", e);
      });
  }, []);

  return (
    <>
      <section className="product-sec">
        <div className="container">
          <div className="row">
            <div className="col-12 col-sm-9 col-lg-10 items new-arrivals">
              <div className="sort-filter d-flex">
                <p>
                  Hide Filters <i className="fa-solid fa-filter" />
                </p>
                <p>
                  Sort By <i className="fa-solid fa-chevron-down" />
                </p>
              </div>
              <div className="new-items row">
                <div className="row row-cols-1 row-cols-sm-2 row-cols-lg-3 g-3">
                  Kids
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default KidsProductList;
